const App = () => {
    const [Number,setNumber] = useState('Click Here');

    const [jatt,yoyo] = useState("You Clicked")

    const x = () => {
        setNumber('Oops');
        yoyo('jatt');
    };

return(
        <div className='masla'>
        <span>Click Below</span>
          <button className='btn' onClick={x} >
            {Number}
          </button>
          </div>
)
};

export default App;
